import React, { Component } from 'react';
import './App.css';
import './Button.js'
import './Select.js'
import { Container, Col, Row } from 'reactstrap';
import Button from './Button.js';
import Select from './Select.js';

class App extends Component {
  render() {
    return (
      <Container>
        <Col align="center">
          <Select />
          <Button />
        </Col>
      </Container>
    )
  }
}

export default App;
